import './';
export default function Header () {
    return (
        <div class="header">
            <span class='header__logo'>Vu Huy Bui</span>
            <div class='header__nav'>
                <span class='header__nav--home'>Home</span>
                <span>About</span>
                <span>Projects</span>
                <span>Contacts</span>
            </div>
        </div>
    )
}
